description:
Gospel Fingers DVD is the fastest and easiest way to learn how to play like the professionals.

It gives you a mix of RnB, Jazz, Classical and Contemporary gospel flavor.
From the beginner to the more advanced musician, this DVD takes you on a journey of phat flavorful chords for talk music, worship, traditional, stride piano and much, much, more.

You too can play like the professionals, with gospel fingers DVD

